import React from 'react';
import { Container, Typography } from '@mui/material';

const Messages = () => {
  return (
    <Container>
      <Typography variant="h4" mb={2}>Messages</Typography>
      {/* Display messages content here */}
    </Container>
  );
};

export default Messages;
